import React from "react";

const Home = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-semibold mb-2">Welcome to TrailBlaze!</h2>
      <p>Your AI-powered career growth assistant.</p>
      <p className="mt-2">Go to <a href="/register" className="text-blue-500 underline">Register</a> to sign up.</p>
    </div>
  );
};

export default Home;
